import React, { useEffect, useState } from 'react';
import Animation from '../pages/Animation';
import axios from 'axios'; // Assuming you are using axios for API calls
import '../CSS/Properties.css'; // If you have specific styles for Properties

const Properties = () => {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    // Fetch properties data from API
    axios.get('https://66262569052332d55321c8d0.mockapi.io/to-do/DataApi')
      .then(response => {
        setProperties(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the data!', error);
      });
  }, []);

  return (
    <div className="properties-container mx-auto p-6">
      <h1 className="text-2xl font-bold text-center mb-6">Welcome to the Property Rental Hub</h1>
      <h2 className="text-xl text-center mb-4">Available Properties</h2>
      <div className="properties-grid grid grid-cols-1 md:grid-cols-1 lg:grid-cols-4 gap-7 ">
        {properties.map((property) => (
          <div
            key={property.id}
            className="property-card flex flex-col justify-between bg-white rounded-lg shadow-lg overflow-hidden"
          >
            <img src={property.image} alt={property.title} className="property-image w-full h-48 object-cover" />
            <div className="property-details p-2 flex flex-col justify-between flex-grow">
              <div>
                <h2 className="text-lg font-semibold mb-2">{property.title}</h2>
                <p className="property-description mb-4 text-gray-700">{property.description}</p>
                <p className="text-gray-800 font-medium">Price: ${property.price}</p>
                <p className="text-gray-600">Location: {property.location}</p>
                <p className="text-gray-600">Bedrooms: {property.bedrooms}</p>
              </div>
              <button className="mt-4 bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600 transition-colors w-28 justify-end">
                Book Now
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};


export default Properties;
